// Imports
import React, { Component } from 'react';
import './userRanking.css';

import GreenArrow from '../img/greenarrow.png';
import RedArrow from '../img/redarrow.png';
import Dice from '../img/dice.png';

class UserRanking extends Component {
  render() {
    return (
      <div className='user_ranking'>
        <p>{this.props.timeOfBet}</p>
        <p>{this.props.userName}</p>
        <img src={RedArrow} className='redArrow2'/>
        <p>Bet</p>
        <img src={Dice} className='dice2'/>
        <img src={GreenArrow} className='greenArrow2'/>
      </div>
    );
  }
}

export default UserRanking;
